#button aspects
def on_click_plot(event):
    #build plot
    fig = figure(num=None, figsize=(8, 6), dpi=80, facecolor='w', edgecolor='k')
    plt.scatter(diabetes[w1.value], diabetes[w2.value], c=color.value, s=100)
    plt.xlabel(w1.value)
    plt.ylabel(w2.value)
    plt.title(w1.value + ' and ' + w2.value)
    #prevent data from displaying on each button click
    plt.close(fig)
    #save to png for display
    fig.savefig('plot.png')

button = pn.widgets.Button(name='Generate Graph')
button.param.watch(on_click_plot, 'clicks')

#add widgets created to next in column
